if (loop == null) { loop = false; }	this.initialize(mode,startPosition,loop,{Intro:0,Scene2:9,Scene3:19,Scene4:29,Scene5:39,Scene6:49,Scene7:59,Outro:69,"Game Over":134});

	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		
		stage.enableMouseOver();
		
		var that = this;
		
		that.btn_a.visible = false;	
		that.btn_b.visible = false;	
		that.btn_c.visible = false;	
		that.btn_d.visible = false;	
		that.btn_next.visible = false;
		that.btn_prev.visible = false;
		that.btn_wrong.visible = false;
		that.btn_correct.visible = false;
		that.Hurt.visible = false;
		
		that.Health1.visible = true;
		that.Health2.visible = true;
		that.Health3.visible = true;
		
		//start button initialization
		this.btn_start.cursor= "pointer";
		this.btn_start.on("click", function(){
				that.intro.play();
				this.visible = false;
			
		});
	}
	this.frame_9 = function() {
		playSound("PyHauntSoundTrack_Demo1mp3copy",-1);
		this.stop();
		
		
		var that = this;
		
		
		//to track which question currently at
		question = 0;
		lives = 3
		
		//array to hold correct answers for each question (each corresponds with one of the selection buttons) 
		var answers = [];
		answers.push([0,0,1,0]);
		answers.push([1,0,0,0]);
		answers.push([1,0,0,1]);
		answers.push([0,0,1,0]);
		answers.push([1,0,0,0]);
		answers.push([0,1,0,0]);
		
		
		
		
		
		function StartQuestion(){
			//show selection buttons
			console.log("here");
			that.btn_wrong.visible = false;
			that.btn_correct.visible = false;
			that.Hurt.visible = false;
			that.btn_a.visible = true;	
			that.btn_b.visible = true;	
			that.btn_c.visible = true;	
			that.btn_d.visible = true;
		}
			
		
		function EndQuestion(){
			that.btn_wrong.visible = false;
			that.Hurt.visible = false;
			that.btn_a.visible = false;	
			that.btn_b.visible = false;	
			that.btn_c.visible = false;	
			that.btn_d.visible = false;	
		}
		
		
		
		
		function check_result(result){	
			
			if (result == 1){
				
				console.log("Question number:"+ question);
				that.btn_next.visible = true;
				that.btn_correct.visible = true;
				that.btn_wrong.visible = false;
				that.btn_a.visible = false;	
				that.btn_b.visible = false;	
				that.btn_c.visible = false;	
				that.btn_d.visible = false;
				
				
			}else{
				console.log('wrong');
				that.Hurt.visible = true;
				setTimeout(HideHurt, 100);
				
				lives--;
				
				if(lives == 2){	
					that.Health3.visible = false;
				}else if(lives == 1){
					that.Health2.visible = false;
				}else if(lives == 0){
					that.Health1.visible = false;
				}else if(lives == -1){
					question = 0;
		            lives = 3
					that.gotoAndPlay("Game Over");
				}
				
				
				
				
				that.btn_wrong.visible = true;
				setTimeout(button_hide, 1500);
		
				
			}
		}
		
		function button_hide(){
			that.btn_wrong.visible = false;	
		}
		function HideHurt(){
			that.Hurt.visible = false;
		}
		
		
		
		
		that.btn_a.on('click', function(){
		check_result(answers[question][0]);
		});
		that.btn_b.on('click', function(){
		check_result(answers[question][1]);
		});
		that.btn_c.on('click', function(){
		check_result(answers[question][2]);
		});
		that.btn_d.on('click', function(){
		check_result(answers[question][3]);
		});
		
		
		that.btn_a.on('mouseover', function(){
		that.btn_a.scaleX = 1.2;
		that.btn_a.scaleY = 1.2;
		});
		that.btn_a.on('mouseout', function(){
		that.btn_a.scaleX = 1;
		that.btn_a.scaleY = 1;
		});
		that.btn_b.on('mouseover', function(){
		that.btn_b.scaleX = 1.2;
		that.btn_b.scaleY = 1.2;
		});
		that.btn_b.on('mouseout', function(){
		that.btn_b.scaleX = 1;
		that.btn_b.scaleY = 1;
		});
		that.btn_c.on('mouseover', function(){
		that.btn_c.scaleX = 1.2;
		that.btn_c.scaleY = 1.2;
		});
		that.btn_c.on('mouseout', function(){
		that.btn_c.scaleX = 1;
		that.btn_c.scaleY = 1;
		});
		that.btn_d.on('mouseover', function(){
		that.btn_d.scaleX = 1.2;
		that.btn_d.scaleY = 1.2;
		});
		that.btn_d.on('mouseout', function(){
		that.btn_d.scaleX = 1;
		that.btn_d.scaleY = 1;
		});
		
		that.btn_a.visible = false;	
		that.btn_b.visible = false;	
		that.btn_c.visible = false;	
		that.btn_d.visible = false;	
		that.btn_next.visible = false;
		that.btn_prev.visible = false;
		that.btn_wrong.visible = false;
		that.btn_correct.visible = false;
		
		//start the main program loop
		setTimeout(StartQuestion,5000);
		
		this.btn_next.cursor= "pointer";
		this.btn_next.on("click", function(){
			that.btn_correct.visible = false;
		    that.gotoAndPlay("Scene"+(question+2));
			question++;
			setTimeout(StartQuestion,5000);
		    this.visible = false;
			
			
		});
		this.stop;
	}
